pragma solidity 0.5.7;

import "./interfaces/VerifiedRates.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";

contract Rates is VerifiedRates, Initializable {

    //fee structure for payments
    struct payments{
        uint256 remittance;
        uint256 withdrawl;
    }

    mapping(address => payments) private paymentFees;

    //fee structure for bond and securities issuing
    struct issues{
        uint256 issuing;
        uint256 redemption;
    }

    mapping(address => issues) private issuingFees;

    //address of who gets Via fees
    address private feeToSetter;

    //address of custodian
    address private custodian;

    //mutex
    mapping(bytes32 => bool) private _lock;

    modifier onlyFeeAdmin(address sender){
        require(sender == feeToSetter, 'Unauthorized access for fee administration');
        _;
    }

    function initialize() public initializer{
        feeToSetter = msg.sender;
        custodian = msg.sender;
    }

    function setFeeTo(address feeTo, uint256 fee, bytes32 feeType) onlyFeeAdmin(msg.sender) external {
        if(feeType=="issuing"){
            issuingFees[feeTo].issuing = fee;
        }
        else if(feeType=="redemption"){
            issuingFees[feeTo].redemption = fee;
        }
        else if(feeType=="remittance"){
            paymentFees[feeTo].remittance = fee;
        }
        else if(feeType=="withdrawl"){
            paymentFees[feeTo].withdrawl = fee;
        }
    }

    //get fee for different services
    function getFee(bytes32 feeType) external view returns(uint256 fee){
        if(feeType=="issuing"){
            return (issuingFees[msg.sender].issuing);
        }
        else if(feeType=="redemption"){
            return (issuingFees[msg.sender].redemption);
        }
        else if(feeType=="remittance"){
            return (paymentFees[msg.sender].remittance);
        }
        else if(feeType=="withdrawl"){
            return (paymentFees[msg.sender].withdrawl);
        }
    }

    function setFeeToSetter(address _feeToSetter) onlyFeeAdmin(msg.sender) external {        
        feeToSetter = _feeToSetter;
    }  

    function setCustodian(address _custodian) onlyFeeAdmin(msg.sender) external {        
        custodian = _custodian;
    }    

    //gets address to which fee income has to be transferred
    function getFeeToSetter() external view returns(address){
        return feeToSetter;
    }

    //get Custodian address for transferring (backing up) assets
    function getCustodian() external view returns(address){
        return custodian;
    }

}
